import { expect } from "chai";
import toggleClass from "../toggleClass.mjs";
describe("Test toggleClass", function () {
  it("toggle add", function () {
    expect(toggleClass("aaa", "bbb")).to.equal("aaa bbb");
  });
  it("not has test", function () {
    expect(toggleClass("aaa bbb", "bbb")).to.equal("aaa");
  });
});